import {Link} from 'react-router-dom';
import OrderForm from './components/OrderForm';
import Order from './components/Order';

import './App.css';

const App = () => {
  return (
    <>
    <Navbar color="info">
      <h1 style={{color: "white"}}>WeEat</h1>
      <Link to={"/"}>
        <Button color="info">
          Home
        </Button>
      </Link>
      </Navbar>
      <Route exact path='/'>
      <Card>
        <CardImg src={require('./assets/taco.jpeg')}/>
        <Button color="info" style={{position: 'absolute', left: '50%', top: '50%'}}>
          Tacos!
        </Button>
      </Card>
      </Route>
      <Route path>

        </Route>
    </>
  );
};
export default App;
